import {React, useEffect} from 'react'
import axios from 'axios'
import '../App.css';

function App() {

useEffect(() => {

  const getData = async () => {

    const options = {
      method: 'GET',
      url: 'https://asos2.p.rapidapi.com/v2/auto-complete',
      params: {
        q: 'bikini top',
        store: 'US',
        country: 'US',
        currency: 'USD',
        sizeSchema: 'US',
        lang: 'en-US'
      },
      headers: {'x-rapidapi-host': 'asos2.p.rapidapi.com', 'x-rapidapi-key': 'SIGN-UP-FOR-KEY'}
    };

    axios.request(options).then(function (response) {
      console.log(response.data);
    }).catch(function (error) {
      console.error(error);
    });
  }

getData()

}, [])
  return (
    <div className="App">

    </div>
  );
}

export default App;
